import {Link} from 'react-router-dom'
const NotFound = () => {
  return (
    <div className="row justify-content-center">
        <div className="col-8 text-center">
                <h1>Page Not Found</h1>
                <h3>Acount must be removed or under maintenance</h3>
                <Link to="/">Home</Link>
        </div>
    </div>
  )
}

export default NotFound
